 import React from "react";
import { Card, Input } from 'reactstrap';

export const ContactsToSelect = () => {
return( 
    <Card>
      <div className="ct-chat-user-item">
          <div className="ct-chat-user-row">

              <div className="ct-chat-contact-col">
                <div className="ct-chat-user-name"/>Daniel Chaves
                <div className="ct-chat-user-des ct-text-truncate"/>daniel.cassiano@live.com
              </div>

              <br/>

              <div className="ct-chat-contact-col">
                <div className="ct-chat-user-name"/>Daniel Chaves
                <div className="ct-chat-user-des ct-text-truncate"/>daniel.cassiano@live.com
              </div>

          </div>
          
      </div>
    </Card>
    );
}
